import React from "react";
import { Menu } from "antd";
import {BellFilled} from '@ant-design/icons'

export default function index() {
  const items = [
    { label: "Trang chủ", key: "item-1" }, // remember to pass the key prop
    { label: (<BellFilled />), key: "item-2" }, // which is required
    { label: "Tài liệu", key: "item-3" }, // which is required
    {
      label: "Mini apps",
      key: "submenu",
      children: [{ label: "item 4", key: "submenu-item-1" }],
    },
    { label: "About", key: "item-5" }, // which is required
  ];

  return <Menu className="nav-header" mode="horizontal" style={{backgroundColor: 'transparent'}} items={items} />;
}
